def hamming_distance(str1, str2):
    answ = 0
    for s1, s2 in zip(str1, str2):
        if (s1 != s2):
            answ += 1
    return answ


def ApproximatePatternCount(Text, Pattern, d):
    answ = []
    for i in range(len(Text) - len(Pattern)+1):
        Pattern_new = Text[i:i + len(Pattern)]
        if hamming_distance(Pattern, Pattern_new) <= d:
            answ.append(i)
    return answ

Text = ''
Pattern = 'GCGATCAAATAG'
d = 4
print(' '.join(map(str, (ApproximatePatternCount(Text, Pattern, d)))))
